private static int decodeOctets(int i,ByteBuffer bb,StringBuilder sb){
    if(bb.remaining() < 1) throw new IllegalArgumentException("Not enough bytes remaining in buffer");
    char c = (char)bb.get(i);
    if(c <= 0x7F){ // Single byte
        sb.append(c);
        return i + 1;
    } else if((c & 0xE0) == 0xC0){ // Two-byte sequence
        if(bb.remaining() < 2) throw new IllegalArgumentException("Not enough bytes remaining in buffer for two-byte sequence");
        char c2 = (char)bb.get(i + 1);
        if((c2 & 0xC0) != 0x80) throw new IllegalArgumentException("Invalid second byte of two-byte sequence");
        sb.append((char)(((c & 0x1F) << 6) | (c2 & 0x3F)));
        return i + 2;
    } else if((c & 0xF0) == 0xE0){ // Three-byte sequence
        if(bb.remaining() < 3) throw new IllegalArgumentException("Not enough bytes remaining in buffer for three-byte sequence");
        char c2 = (char)bb.get(i + 1);
        char c3 = (char)bb.get(i + 2);
        if(((c2 & 0xC0) != 0x80) || ((c3 & 0xC0) != 0x80)) throw new IllegalArgumentException("Invalid second or third byte of three-byte sequence");
        sb.append((char)(((c & 0x0F) << 12) | ((c2 & 0x3F) << 6) | (c3 & 0x3F)));
        return i + 3;
    } else if((c & 0xF8) == 0xF0){ // Four-byte sequence
        if(bb.remaining() < 4) throw new IllegalArgumentException("Not enough bytes remaining in buffer for four-byte sequence");
        char c2 = (char)bb.get(i + 1);
        char c3 = (char)bb.get(i + 2);
        char c4 = (char)bb.get(i + 3);
        if(((c2 & 0xC0) != 0x80) || ((c3 & 0xC0) != 0x80) || ((c4 & 0xC0) != 0x80)) throw new IllegalArgumentException("Invalid second, third, or fourth byte of four-byte sequence");
        sb.append((char)(((c & 0x07) << 18) | ((c2 & 0x3F) << 12) | ((c3 & 0x3F) << 6) | (c4 & 0x3F)));
        return i + 4;
    } else {
        throw new IllegalArgumentException("Invalid UTF-8 encoding at position " + i);
    }
}

