    if(str==null||index<0||len<=0||index+len>str.length()){
        throw new IllegalArgumentException("Invalid arguments");
    }
    int size=0;
    for(int i=index;i<index+len;i++){
        char c=str.charAt(i);
        if(c<=0x7F){
            size++;
        }else if(c<=0x7FF){
            size+=2;
