    int last = values.get(values.size()-1);
    //swap the last element with the one to delete
    values.set(map.get(val),last);
    //update the map entry for the last element
    map.put(last,map.get(val));
    //delete the last element
    values.remove(values.size()-1);
    //delete the key-value pair in the map
    map.remove(val);
    return true;
}

