public Converter lookup(final Class<?> clazz){
    if (clazz == null) {
        return null;
    }
    // Check for direct registration
    if (this.converters.containsKey(clazz)) {
        return this.converters.get(clazz);
    }

    // Check for array type
    if (clazz.isArray()) {
        Class<?> componentType = clazz.getComponentType();
        if (componentType != null && this.converters.containsKey(componentType)) {
            return new ArrayConverter(this.converters.get(componentType), componentType);
        }
    }

    // Check for primitive types and their corresponding wrapper classes
    if (clazz.isPrimitive()) {
        Class<?> wrapperClass = getWrapperClassForPrimitive(clazz);
        if (wrapperClass != null && this.converters.containsKey(wrapperClass)) {
            return this.converters.get(wrapperClass);
        }
    } else if (clazz.equals(Boolean.class)) {
        if (this.converters.containsKey(Boolean.TYPE)) {
            return this.converters.get(Boolean.TYPE);
        }
    }

    // Check for standard types
    if (isStandardType(clazz)) {
        if (this.converters.containsKey(clazz)) {
            return this.converters.get(clazz);
        }
    }

    // Check for other types
    if (this.converters.containsKey(clazz)) {
        return this.converters.get(clazz);
    }

    return null;
}

public long readRawVarint64() throws IOException {
    if (bufferPos == bufferSize) {
        refillBuffer(true);
    }
    int b = buffer[bufferPos++];
    if ((b & 0x80) == 0) {
        return b;
    }
    long result = b & 0x7F;
    if ((b = buffer[bufferPos++]) < 0) {
        result |= (b << 7);
    } else {
        result |= (b << 7);
        if ((b = buffer[bufferPos++]) < 0) {
            result |= (b << 14);
        } else {
            result |= (b << 14);
            if ((b = buffer[bufferPos++]) < 0) {
                result |= (b << 21);
            } else {
                result |= (b << 21);
                if ((b = buffer[bufferPos++]) < 0) {
                    result |= (b << 28);
                } else {
                    result |= (b << 28);
                    if ((b = buffer[bufferPos++]) < 0) {
                        result |= ((long)b << 35);
                    } else {
                        result |= ((long)b << 35);
                        if ((b = buffer[bufferPos++]) < 0) {
                            result |= ((long)b << 42);
                        } else {
                            result |= ((long)b << 42);
                            if ((b = buffer[bufferPos++]) < 0) {
                                result |= ((long)b << 49);
                            } else {
                                result |= ((long)b << 49);
                                if ((b = buffer[bufferPos++]) < 0) {
                                    throw new InvalidProtocolBufferException("Malformed Varint");
