protected GraphPath<V,E> edgeSetToTour(Set<E> tour,Graph<V,E> graph){
    if(tour.isEmpty()){
        return null;
    }
    List<V> vertexList = new ArrayList<>();
    for(E e : tour){
        if(!vertexList.contains(graph.getEdgeSource(e))){
            vertexList.add(graph.getEdgeSource(e));
        }
        if(!vertexList.contains(graph.getEdgeTarget(e))){
            vertexList.add(graph.getEdgeTarget(e));
        }
    }
    Collections.sort(vertexList,new Comparator<V>() {
        @Override
        public int compare(V v1,V v2) {
            if(vertexList.indexOf(v1)<vertexList.indexOf(v2)){
                return -1;
            }else if(vertexList.indexOf(v1)>vertexList.indexOf(v2)){
                return 1;
            }else{
                return 0;
            }
        }
    });
    List<E> edgeList = new ArrayList<>();
    for(int i=0;i<vertexList.size()-1;i++){
        E e = graph.getEdge(vertexList.get(i),vertexList.get(i+1));
        if(e!=null){
            edgeList.add(e);
        }
    }
    if(edgeList.isEmpty()){
        return null;
    }
    return new DefaultGraphPath<>(graph,vertexList,edgeList,vertexList.size());
}

