private boolean unlink(ListNodeImpl<E> node){
    if(node==null||node.prev==null||node.next==null){
        return false;
    }
    ListNodeImpl<E> prev=node.prev;
    ListNodeImpl<E> next=node.next;
    prev.next=next;
    next.prev=prev;
    node.prev=null;
    node.next=null;
    size--;
    return true;
}

