public static Type resolveBound(TypeVariable<?> typeVariable){
    if(typeVariable.getBounds().length == 0){
        return Unknown.class;
    }
    Type bound = typeVariable.getBounds()[0];
    if(bound instanceof Class){
        return (Class)bound;
    }else if(bound instanceof ParameterizedType){
        return resolveClass((ParameterizedType)bound,Unknown.class);
    }else if(bound instanceof WildcardType){
        WildcardType wildcardType = (WildcardType)bound;
        if(wildcardType.getUpperBounds().length > 0){
            return resolveBound(wildcardType.getUpperBounds()[0]);
        }else{
            return Unknown.class;
        }
    }else if(bound instanceof GenericArrayType){
        GenericArrayType genericArrayType = (GenericArrayType)bound;
        if(genericArrayType.getGenericComponentType() instanceof Class){
            return Array.newInstance((Class)genericArrayType.getGenericComponentType(),0).getClass();
        }else{
            return Unknown.class;
        }
    }else if(bound instanceof TypeVariable){
        return resolveBound((TypeVariable<?>)bound);
    }else{
        return Unknown.class;
    }
}

