private List<Integer> computeUpperBounds(List<K> keys){
    if (upperBounds.isEmpty()){
        throw new IllegalStateException("No upper bounds have been added.");
    }
    List<Integer> result = new ArrayList<>(keys.size());
    for (K key : keys) {
        int minUpperBound = Integer.MAX_VALUE;
        for (Function<K, Integer> upperBound : upperBounds) {
            int currentUpperBound = upperBound.apply(key);
            if (currentUpperBound < minUpperBound) {
                minUpperBound = currentUpperBound;
            }
        }
        result.add(minUpperBound);
    }
    return result;
}

