public int readTag() throws IOException {
    if (buffer.remaining() == 0) {
        return 0;
    }
    int b = buffer.get() & 0xFF;
    if ((b & TAG_TYPE_MASK) == WIRETYPE_VARINT) {
        int result = b >>> TAG_TYPE_BITS;
        while ((b & 0x80) != 0) {
            b = buffer.get() & 0xFF;
            result <<= 7;
            result |= b & 0x7F;
        }
        return result;
    } else {
        return makeTag(b >>> TAG_TYPE_BITS, b & TAG_TYPE_MASK);
    }
}

