public static List<ThreadSnapshot> parseFromFileWithTimeRange(File file,List<ProfileAnalyzeTimeRange> timeRanges) throws IOException {
    List<ThreadSnapshot> threadSnapshots = new ArrayList<>();
    try (FileInputStream fis = new FileInputStream(file)) {
        // Read the file content and process it
        byte[] buffer = new byte[1024];
        int bytesRead;
        while ((bytesRead = fis.read(buffer)) != -1) {
            // Process each chunk of data
            for (ProfileAnalyzeTimeRange timeRange : timeRanges) {
                if (timeRange.isWithinRange(bytesRead)) {
                    ThreadSnapshot snapshot = new ThreadSnapshot();
                    // Populate the snapshot with data
                    threadSnapshots.add(snapshot);
                }
            }
        }
    }
    return threadSnapshots;
}
